Installation
Using npm:
$ npm install --save mixiner

TypeScript:
import mixiner from 'mixiner';

Node.js / CommonJS:
const mixiner = require('mixiner');

ES2015 / TypeScript:
import mixiner from 'mixiner/es/mixiner';

