mixiner.mixedBy()
Description: Tests whether an object mixined by mixin class.


mixiner.mixedBy(object, Class);

objectType: ObjectThe object (instance) to test.  

ClassType: ClassMixin class.  

Return valueType: BooleanTest result  

Examples TypeScript
// create mixin
class SpeackableMixin {
    protected sound: string;
    public speak(): string {
        return this.sound;
    }
}
// implement SpeackableMixin
class Duck extends mixiner.mix(SpeackableMixin) {
    protected sound = 'quack';
}
// create instance
const donald = new Duck();
// test instance
mixiner.mixedBy(donald, SpeackableMixin); // true
mixiner.mixedBy(donald, Duck); // false

api/instance-of.html.body:
mixiner.instanceOf()
Description: Tests whether an object instance of class or mixined by mixin class.


mixiner.instanceOf(object, Class);

objectType: ObjectThe object (instance) to test.  

ClassType: ClassClass or mixin class.  

Return valueType: BooleanTest result  

Examples TypeScript
// create mixin
class SpeackableMixin {
    protected sound: string;
    public speak(): string {
        return this.sound;
    }
}
// implement SpeackableMixin
class Duck extends mixiner.mix(SpeackableMixin) {
    protected sound = 'quack';
}
// create instance
const donald = new Duck();
// test instance
donald instanceof SpeackableMixin; // false
mixiner.instanceOf(donald, SpeackableMixin); // true
mixiner.instanceOf(donald, Duck); // true

